  input: '"TEXT","F3XA","C00143743","This amendment reflects requested corrections
    and is filed pursuant to your letter dated 09/22/04.  Schedule A Line 15 reported
    receipt from Marriott Rivercenter of $28,659.39 was inadvertently recorded as
    an offset to operating expenses and deposited to our Federal account on 07/14/2004.
    However, also on 07/14/2004, 72% of the receipt (or $20,634.76) was transferred
    to our Corporate account as disclosed in our August monthly FEC report.  The remaining
    28% ($8,024.63) that is currently in our Federal account will be transferred to
    our Corporate account on November 3, 2004 (as early as is permitted by the Texas
    Ethics Commission),  and will be disclosed in our Post-General election FEC report.  Schedule
    A line 15 offsets to operating expenses from Accor North America -Red Roof Inn:
    This receipt represents payment from the parent company for Red Roof Inns and
    offsets a disbursement made to Red Roof Inns on 05/19/04.  Schedule A Line 12,
    transfer-in from the NRCC: we are happy to confirm that no national party transfer
    funds were used to pay for any volunteer activity or for any campaign materials
    purchased for distribution by volunteers. All conditions outlined in your letter
    regarding volunteer activity have been strictly adhered to by the party."'
